-- Datenbank (erneut) anlegen und wechseln
:SETVAR dbname dotnetconsulting_TSQL2
USE [master];
IF EXISTS (SELECT * FROM [sys].[databases] WHERE [name] = '$(dbname)')
BEGIN
	ALTER DATABASE [$(dbname)] SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
	DROP DATABASE [$(dbname)];
	PRINT '''$(dbname)''-Datenbank gelöscht';
END
GO
CREATE DATABASE [$(dbname)];
GO
USE [$(dbname)];
PRINT '''$(dbname)''-Datenbank erstellt und gewechselt';
GO

SET ANSI_NULLS, ANSI_PADDING, ANSI_WARNINGS, ARITHABORT, CONCAT_NULL_YIELDS_NULL, QUOTED_IDENTIFIER, NOCOUNT ON;

SET NUMERIC_ROUNDABORT OFF;

PRINT N'Creating [dbo].[Fahrtzeiten]...';


GO
CREATE TABLE [dbo].[Fahrtzeiten] (
    [ID]                 INT          IDENTITY (1, 1) NOT NULL,
    [Station]            VARCHAR (50) NOT NULL,
    [FahrtzeitInMinuten] INT          NOT NULL,
    CONSTRAINT [PK_Fahrzeiten] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Creating [dbo].[Personenverzeichnis]...';


GO
CREATE TABLE [dbo].[Personenverzeichnis] (
    [ID]            INT          IDENTITY (1, 1) NOT NULL,
    [VorgesetzerID] INT          NULL,
    [Name]          VARCHAR (50) NOT NULL,
    [Vorname]       VARCHAR (50) NOT NULL,
    [Kommentar]     VARCHAR (50) NULL,
    CONSTRAINT [PK_Personenverzeichnis] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Creating [dbo].[Produktverzeichnis]...';


GO
CREATE TABLE [dbo].[Produktverzeichnis] (
    [ID]           INT             IDENTITY (1, 1) NOT NULL,
    [EAN]          VARCHAR (14)    NOT NULL,
    [Bezeichnung]  VARCHAR (100)   NOT NULL,
    [Beschreibung] VARCHAR (400)   NULL,
    [Preis]        DECIMAL (18, 2) NOT NULL,
    [ProductPage]  VARCHAR (256)   NOT NULL,
    CONSTRAINT [PK_Produktverzeichnis] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Creating [dbo].[Vertriebszahlen]...';


GO
CREATE TABLE [dbo].[Vertriebszahlen] (
    [ID]     INT             IDENTITY (1, 1) NOT NULL,
    [Name]   VARCHAR (50)    NOT NULL,
    [Umsatz] DECIMAL (18, 2) NOT NULL,
    [Land]   VARCHAR (50)    NOT NULL,
    CONSTRAINT [PK_Adressen] PRIMARY KEY CLUSTERED ([ID] ASC)
);


GO
PRINT N'Creating [dbo].[FK_Personenverzeichnis_Personenverzeichnis]...';


GO
ALTER TABLE [dbo].[Personenverzeichnis] WITH NOCHECK
    ADD CONSTRAINT [FK_Personenverzeichnis_Personenverzeichnis] FOREIGN KEY ([VorgesetzerID]) REFERENCES [dbo].[Personenverzeichnis] ([ID]);


GO
PRINT N'Checking existing data against newly created constraints';


GO
ALTER TABLE [dbo].[Personenverzeichnis] WITH CHECK CHECK CONSTRAINT [FK_Personenverzeichnis_Personenverzeichnis];


GO
GO

DECLARE @pv binary(16)
BEGIN TRANSACTION
ALTER TABLE [dbo].[Personenverzeichnis] DROP CONSTRAINT [FK_Personenverzeichnis_Personenverzeichnis]
